import React, { useEffect, useState } from 'react';
import './floating-notes.scss';
import io from 'socket.io-client';

const FloatingNotes = () => {

  return(
    <div className="floating_main_cont">

    <style jsx>{`
      .floating_main_cont{
        position: fixed;
        bottom: 0;
        left: 0;
        border: 1px solid red;
        width: 30%;
        height: 100vh;
      }
    `}
    </style>
    </div>
  )
}

export default FloatingNotes;
